('About CpE Student Portal', '<h3><strong>OVERVIEW</strong></h3>\n								<hr/>\n								<h4>ABOUT CpE Student Portal</h4>\n								<p>CpE Student Portal is for Computer Engineering students Mariano Marcos State University - College of Engineering, that serves as a personal assistant in carrying out academic-related tasks.</p>\n								<p>Students can view their personal details, schedules, current grades, accountabilities, curriculum checklist, and more.</p>\n								<hr/>\n								<h4>FEATURES AVAILABLE</h4>\n								<p><strong>News and Announcements</strong>: where a student can read a feed of the latest news and announcements from the faculty/organization.</p>\n								<p><strong>Personal Datasheet</strong>: where a student can view and update his/her personal information.</p>\n								<p><strong>Subject Schedules</strong>: where a student can view all subjects with their time schedules for the current term.</p>\n								<p><strong>Grades Transcript</strong>: shows the final grades in the previous terms of the student.</p>\n								<p><strong>School Calendar</strong>: where a student can view upcoming events and holidays within the academic year.</p>\n								<p><strong>Statement of Accounts</strong>: shows if a student still has account balance from the organizational office.</p>\n								<p><strong>General Information</strong>: where the student can view general information with regards to their stay at the university/college.</p>\n								<p><strong>Hymn and March</strong>: where a student can listen to and read (memorize) the lyrics of the university anthems.</p>\n								<hr/>\n								<h4>FORGOT PASSWORD?</h4>\n								<p>Proceed to the Computer Engineering Department, 1st Floor, College of Engineering, Mariano Marcos State University and ask a faculty member.</p>\n', 1, '2018-03-03 08:49:02', 1),
('<i class=\"fa fa-fw fa-eye\"></i> Mission and Vision', '<p style=\"text-align: center;\"><span><span style=\"font-size:16px;\"><strong>VISION</strong></span></span></p> 									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\">A world-class university dedicated to the development of virtuous human resources and innovations for inclusive growth.</span></span></p> 									<hr/> 									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\"><strong>MISSION</strong></span></span></p> 									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\">To develop globally competitive professionals and industry-ready graduates via various modalities and generate new knowledge and technologies for the improvement of the quality of life.</span></span></p>', 2, '2018-03-03 17:02:30', 1),
('<i class=\"fa fa-fw fa-university\"></i> University Core Values', '<ol style=\"text-align: justify;\"> 										<li><span ><span style=\"font-size:16px;\">Excellence</span></span></li> 										<li><span ><span style=\"font-size:16px;\">Integrity</span></span></li> 										<li><span ><span style=\"font-size:16px;\">Service to God and Nation</span></span></li> 									</ol>', 3, '2018-03-03 17:02:30', 1),
('<i class=\"fa fa-fw fa-dot-circle-o\"></i> Goals and Objectives', '<ol style=\"text-align: justify;\"> 										<li><span ><span style=\"font-size:14px;\">Offer a wide range of academic programs at the certificate, associate, baccalaureate, masters and doctorate levels;</span></span></li> 										<li><span ><span style=\"font-size:14px;\">Maintain a broad range of research programs both in the basic and applied sciences, especially in the arts, agriculture, agribusiness, agroforestry, fisheries, teacher education, rural sociology, management, and technology which will generate knowledge and provide a basis for solutions to the development needs of the province and region;</span></span></li> 										<li><span ><span style=\"font-size:14px;\">Provide off-campus instructional  continuing education and extension services to meet the needs  of residents of the province and the region within the context of the regional and national non-formal education; and</span></span></li> 										<li><span ><span style=\"font-size:14px;\">Serve as the locus for the regional cooperative and development center for public and private colleges and universities in the Ilocos region.</span></span></li> 									</ol>', 4, '2018-03-03 17:02:30', 1),
('<i class=\"fa fa-fw fa-legal\"></i> Rights of Students', '<p style=\"text-align: center;\"><span><span style=\"font-size:16px;\">Subject to limitations prescribed by law and the university policies and regulations, every pupil or student of the university shall enjoy the following rights:</span></span></p>\n									<hr/>\n									<ol style=\"text-align: justify;\">\n										<li>The right to receive quality and relevant education through competent instruction in accordance to national goals, educational objectives, and the standards of the university for his full development as human being.</li>\n										<li>The right to guidance and counseling services to provide himself with appropriate opportunities to know himself, to make decisions, and to elect the field of work suited to his potentials.</li>\n										<li>The right to free expression of beliefs and opinions as long as it does not disrupt the administrative, academic and discipline of the university.</li>\n										<li>The right to publish a school organ or similar publication.</li>\n										<li>The right to invite resource speakers during convocation, fora, symposia, and assemblies of similar nature.</li>\n										<li>The right to participate in the formulation and development of policies affecting the university in the relation to the locality/region and nation through representation in the appropriate bodies of the university to be determined by the Board of Regents.</li>\n										<li>The right to establish, join and participate in organizations, societies and clubs recognized by the university for the purposes not contrary the law.</li>\n										<li>The right to be given reasonable protection within the university premises.</li>\n										<li>The right to be informed of his rights as well as the policies, rules, and regulations affecting him.</li>\n										<li>The right to participate in curricular and co-curricular activities.</li>\n										<li>The right to be respected as a person with human dignity, to full physical, social, intellectual and moral development, to humane and healthful conditions of learning.</li>\n										<li>The right to enjoy academic freedom.</li>\n										<li>The right to redress of grievances against any wrong or injustice committed against him by other students or by any member of the academic community in accordance with the defined procedures and channels of authority therein.</li>\n										<li>The right to subjected to disciplinary action only after requisites of due process have been fully complied with.</li>\n										<li>The right to access to his university records, the confidentiality of which the university shall keep and maintain.</li>\n										<li>The right to pursue and continue his course until the graduates except in cases of academic deficiency or violation of disciplinary regulations.</li>\n										<li>The right to be given assistance on work opportunities through current and available information.</li>\n										<li>The right to be expeditious issuance of official documents like certificates, diplomas, transcript of records, grades and transfer credential.</li>\n										<li>The right to be free from involuntary contributions except those approved by their own organizations, clubs or societies.</li>\n									</ol>', 5, '2018-03-03 17:02:45', 1),
('<i class=\"fa fa-fw fa-tasks\"></i> Duties and Responsibilities', '<p style=\"text-align: center;\"><span style=\"color:#555555;\"><span style=\"font-size:16px;\">Every student shall:</span></span></p>\n									<ol style=\"text-align: justify;\">\n										<li>Love God and his fellowmen as he loves himself.</li>\n										<li>Strive to lead a virtuous and useful life.</li>\n										<li>Observe the Code of Student Conduct promulgated by the university.</li>\n										<li>Do his best to develop his potentials for service, specially by undergoing an education suited to his abilities so that he may become an asset to society.</li>\n										<li>Respect the customs and traditions of our people, its duly constituted authorities, the laws of the land, and the rules and policies of the university.</li>\n										<li>Participate actively in civic affairs and in the promotion of the general welfare and in the attainment of a just, orderly and compassionate society.</li>\n										<li>Help in the exercise of individual and social rights, the strengthening of freedom, and enhancement of cooperation among communities and regions in the pursuit of national progress.</li>\n										<li>Uphold the academic and moral integrity of the university by trying to achieve excellence and moral uprightness.</li>\n										<li>Promote and preserve the peace and order in the university by observing the rules on discipline and harmonious relationship with fellow students and with the university personnel.</li>\n										<li>Exercise his rights responsively in the knowledge that he is answerable to God for any violation of the general welfare and of the rights of the others.</li>\n									</ol>', 6, '2018-03-01 12:35:11', 1),
('<i class=\"fa fa-fw fa-certificate\"></i> Student Conduct', '<p style=\"text-align: center;\"><span><span style=\"font-size:16px;\">Students shall observe, at all times, the laws of the land and the rules and regulations of the university.</span></span></p>\n									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\">No disciplinary proceedings shall be instituted except for conduct prohibited by laws or by rules and regulations promulgated by the duly constituted authorities of the university.</span></span></p>\n									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\">When a student is accepted in any college or unit of the university, a binding contract is establish between him and MMSU whereby both agree to conform to the laws of the land and to the rules and regulations of the university. Upon his registration, the student assumes all his duties and responsibilities toward the country, the university, the college or unit where he belongs, the university personnel and his fellow students. </span></span></p>\n									<hr/>\n									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\"><strong>SPECIFIC MISCONDUCT</strong></span></span></p>\n									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\">A student shall be subject to disciplinary action for committing any of the following offenses: </span></span></p>\n									<p style=\"text-align: center;\"><span><span style=\"font-size:16px;\"><strong>Major Offenses:</strong></span></span></p>\n									<ol style=\"text-align: justify;\">\n										<li>Cheating in examinations and/or any act of dishonesty like forging and/or tampering academic or offcial records or documents.</li>\n										<li>Carrying firearm or deadly weapon within the university premises, as long as this shall not apply to bladed items which are needed in connection with instruction, experiments and field work which have prior permit from the dean/director or instructor of the college/unit.</li>\n										<li>Drinking liqour or drunken behavior within the university premises.</li>\n										<li>Unauthorized or illegal possesion or use/distribution of prohibited drugs, chemicals or substances like marijuana, rugby, shabu, opiates, heroine, ecstasy or any of its form.</li>\n										<li>Gambling within the university premises.</li>\n										<li>Conducting illegal activities like hazing or harmful initiation rites.</li>\n										<li>Creating and/or participating in disorder, tumultous, or other serious disturbances such as illegal assembly and demonstrations with violence within the uiversity premises.</li>\n										<li>Intentionally making false statements, practicing or attempting to practice any deception, fraud or forgery in connection with his admission and graduation from the university.</li>\n										<li>Bringing the name of the university in shame.</li>\n										<li>Willful destruction or vandalism of university properties or properties belonging to personnel, students or visitors while in campus.</li>\n										<li>Commission of a minor offense for the third time.</li>\n										<li>Committing acts of lasciviousness. within the campus.</li>\n										<li>Willfull and habitual disregard of the established policies and regulations.</li>\n										<li>Inflicting physical injuries tp personnel, students, or visitors within the campus.</li>\n										<li>Threatening another to inflict injury upon his personn honor, property, or any act amounting to a crime.</li>\n										<li>Physical attack on a person by reason of his office. Stealing or any attempt thereof.</li>\n										<li>Any other form of serious misconduct.</li>\n									</ol>\n									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\"><strong>Sanctions for Major Offenses</strong></span></span></p>\n									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\">The gravity of the offense, the circumstances attending to its commission and the frequency of the act shall determine the nature of the disciplinary action or penalty to be imposed under this category in which case the sanctions below shall be applied: </span></span></p>\n									<ol style=\"text-align: justify;\">\n										<li>Suspension for a maximum period not exceeding 20 percent of the prescribed school days.</li>\n										<li>Probation with automatic suspension for the rest of the semester.</li>\n										<li>Suspension for one semester.</li>\n										<li>Suspension for two semesters.</li>\n										<li>Dismissal or dropping from the university upon which the transfer credentials of the offender shall be issued immediately.</li>\n										<li>Expulsion</li>\n									</ol>\n									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\"><strong>Minor Offenses</strong></span></span></p>\n									<p style=\"text-align: center;\"><span ><span style=\"font-size:16px;\">A student shall be subjected to disciplinary sction for committing any of the following minor offenses: </span></span></p>\n									<ol style=\"text-align: justify;\">\n										<li>Open and public display of arrogance and disrespect to school authorities and other personnel. </li>\n										<li>Disrupting one\'s class or that of others by shouting, whistling, running,  raucous unrestrained laughter and other similar disturbances. </li>\n										<li>Causing and/or participating in verbal tussles and other minor disturbances within the university premises.</li>\n										<li>Using other\'s ID card or lending one\'s ID card to another.</li>\n										<li>Any other form of minor misconduct.</li>\n									</ol>', 7, '2018-03-03 17:04:06', 1),
('<span style=\"font-size: large;\">MMSU March</span>', '<p><span>Dear Mariano Marcos State University</span></p>\n								<p><span>We now sing of thy real glory</span></p>\n								<p><span>We adore thee and love thee truly</span></p>\n								<p><span>Where\'er we shall chance to roam</span></p>\n								<p><span>Thy sons and daughters will ever love thee</span></p>\n								<p><span>Are to thee loyal and true</span></p>\n								<p><span>Always Alma Mater dear,</span></p>\n								<p><span>Where\'er we go, we\'ll think of thee.</span></p>\n								<p><span> </span></p>\n								<p><span>Thou hast been always longing</span></p>\n								<p><span>For the welfare of thy children</span></p>\n								<p><span>And to them, thou hast devoted</span></p>\n								<p><span>Thy attention and best care</span></p>\n								<p><span>We soon shall be repaying</span></p>\n								<p><span>For the cares and kindness true</span></p>\n								<p><span>We will ever Alma Mater</span></p>\n								<p><span>Give the best in us for thee.</span></p>', 8, '2018-03-01 12:57:19', 1),
('<span style=\"font-size: large;\">MMSU Hymn</span>', '					<p><span>MMSU dear</span></p>\n								<p><span>Alma Mater beloved</span></p>\n								<p><span>To you we promise our never ending love;</span></p>\n								<p><span>Though fate may bring us</span></p>\n								<p><span>To other lands afar,</span></p>\n								<p><span>Our hearts and thoughts will always be</span></p>\n								<p><span>With you wherever we are.</span></p>\n								<p><span> </span></p>\n								<p><span>Hold high the green and gold</span></p>\n								<p><span>Waving with pride and hope;</span></p>\n								<p><span>Inspiring us to rise</span></p>\n								<p><span>To reach the greatest heights.</span></p>\n								<p><span>With your kind guiding hand,</span></p>\n								<p><span>We know we\'ll never fail</span></p>\n								<p><span>To reap success and give the best</span></p>\n								<p><span>For you and our Fatherland.</span></p>\n								<p><span>(Repeat)</span></p>\n								<p><span> </span></p>\n								<p><span>To reap success and give the best</span></p>\n								<p><span>For you and our Fatherland,</span></p>\n								<p><span>MMSU...</span></p>', 9, '2018-03-01 12:57:23', 1);
